import InlineCSS from "./components/InlineCSS";
import ObjectVariabelCSS from "./components/ObjectVariabelCSS";
import ExternalCSS from "./components/ExternalCSS";

function App() {
	return (
		<div className="App">
			<h3>Penggunaan Inline CSS :</h3>
			<InlineCSS />
			<hr />
			<h3>Penggunaan Object Variabel CSS</h3>
			<ObjectVariabelCSS />
			<hr />
			<h3>Penggunaan External CSS</h3>
			<ExternalCSS />
			<hr />
		</div>
	);
}

export default App;
